import React from 'react';

const InterviewGuidance = () => {
  return (
    <div className="p-4 max-w-lg mx-auto">
      <h2 className="text-2xl font-semibold mb-4">Interview Guidance</h2>
      <p>Here are some tips for your upcoming interviews:</p>
      <ul className="list-disc ml-4">
        <li>Research the company thoroughly.</li>
        <li>Prepare for common interview questions.</li>
        <li>Dress professionally and be on time.</li>
        <li>Have questions ready for the interviewer.</li>
        <li>Stay calm and confident during the interview.</li>
      </ul>
    </div>
  );
};

export default InterviewGuidance;
